import { Carousel } from 'antd';
import C1 from '../Images/C1.jpg'
import C2 from '../Images/C2.jpg'
import C3 from '../Images/C3.jpg'
import C4 from '../Images/C4.jpg'


const contentStyle = {
  height: '534px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#364d79',
  
};
const Crous = () => (
  <Carousel autoplay>
    <div>
    <h3  style={contentStyle}><img className='cr' src={C1}></img></h3>
      
    </div>
    <div>
    <h3 style={contentStyle}><img className='cr' src={C2}></img></h3>    </div>
    <div>
    <h3 style={contentStyle}><img className='cr' src={C3}></img></h3>    </div>
    <div>
    <h3 style={contentStyle}><img className='cr' src={C4}></img></h3>    </div>

    
  </Carousel>
);
export default Crous;
